export class Event {
    // Event Data
    eventID = '';
    entryTime = '';
    exitTime = '';
    date = '';

    constructor(eventID, entryTime, exitTime, date) {
        this.eventID = eventID;
        this.entryTime = entryTime;
        this.exitTime = exitTime;
        this.date = date;
    }
}
